/**
 * @description Returns {String} of HTTP path requests
 */
import Project_Statuses from './Projects_Statuses';
import Project_DeliveryTypes from './Projects_DeliveryTypes';
const MAIN_PATH = '/api/projects';

export default class PROJECTS {
   /**
    * @description HTTP GET
    */
   static GET_PROJECTS = MAIN_PATH + '/';

   /**
    * @description HTTP GET
    */
   static GET_PROJECT_BY_NAME = MAIN_PATH + '/id=';

   /**
    * @description HTTP POST
    */
   static CREATE_NEW_PROEJCT = MAIN_PATH + '/';

   /**
    * @description HTTP PUT
    */
   static UPDATE_PROJECT = MAIN_PATH + '/';

   /**
    * @description HTTP POST
    */
   static MARK_PROJECT_AS_RETIRED_BY_ID = MAIN_PATH + '/retire/id=';

   /**
    * @description HTTP DELETE => +PROJECT.ID
    */
   static DELETE_PROJECT_BY_ID = MAIN_PATH + '/id=';

   /**
    * @description PROJECT_STATUSES ROUTES CONTAINER
    */
   static PROJECT_STATUSES = Project_Statuses;

   /**
    * @description PROJECT_DELIVERY_TYPES ROUTES CONTAINER
    */
   static PROJECT_DELIVERY_TYPES = Project_DeliveryTypes;
}
